const generateSeats = (capacity) => {
  const seats = [];
  const rows = ['A', 'B', 'C', 'D', 'E', 'F', 'G', 'H', 'I', 'J'];
  const seatsPerRow = Math.floor(capacity / rows.length);
  rows.forEach((row, rowIndex) => {
    for (let i = 1; i <= seatsPerRow; i++) {
      seats.push({
        row,
        number: i,
        type: rowIndex >= 7 ? 'premium' : 'standard' // Last 3 rows premium
      });
    }
  });
  return seats;
};

async function seedData() {
  try {
    await mongoose.connect('mongodb://localhost:27017/moviestream', {
      useNewUrlParser: true,
      useUnifiedTopology: true,
    });

    await Movie.deleteMany({}); // Clear existing movies
    await Theater.deleteMany({});
    await Screen.deleteMany({});

    const insertedMovies = await Movie.insertMany(hindiMovies);
    const insertedTheaters = await Theater.insertMany(theaters);

    const screens = [
      { theater: insertedTheaters[0]._id, screenNumber: 1, capacity: 150, seats: generateSeats(150) },
      { theater: insertedTheaters[0]._id, screenNumber: 2, capacity: 120, seats: generateSeats(120) },
      { theater: insertedTheaters[1]._id, screenNumber: 1, capacity: 200, seats: generateSeats(200) },
      { theater: insertedTheaters[1]._id, screenNumber: 2, capacity: 180, seats: generateSeats(180) },
      { theater: insertedTheaters[2]._id, screenNumber: 1, capacity: 100, seats: generateSeats(100) },
    ];

    await Screen.insertMany(screens);

    console.log('Data seeded successfully!');
  } catch (error) {
    console.error('Error seeding data:', error);
  } finally {
    mongoose.connection.close();
  }
}

seedData();
